import "../styles/globals.css";
import { AccountProvider } from "../components/AccountContext";

function MyApp({ Component, pageProps }) {
  const account = { id: "1", address: "" };
  return (
    <AccountProvider value={account}>
      <Component {...pageProps} />
    </AccountProvider>
  );
}

export default MyApp;
